('node', 'city', 0, 77, 77, 'und', 0, '<p><strong>Lviv, a city in western Ukraine, is regarded as one of the main cultural centers of Ukraine. In 2009 it&nbsp;has been recognized as the cultural capital of Ukraine.</strong></p><p>On the 28th of April 2009, Lviv has been recognized as the cultural capital of Ukraine. This status award was given based on expert research of The State service of tourism and resorts and &ldquo;The Council on tourism and resorts issues&rdquo;. The main reasons of such obtaining is the conducting of more than 100 festivals annually, 60 museums, 100 churches of different confessions, and the big tourist interest in Lviv.</p><p>For the past 2 years the tourist stream to the city increased by 40 %, and now it is more than a million people per year.</p><p>Among the foreigners, the biggest amount of tourists come from Poland, Germany, Austria, Belarus, USA and Russia.</p><p>The city is known as a center of art, literature, music and theatre. Nowadays, the indisputable evidences of the city cultural richness is a big number of theaters, concert halls, creative unions, and also high number of many artistic activities. Temples, frescos, paintings, traditions, feasts, festivals &ndash; all these are the heirdom of the past and the product of the present geniuses, which can be felt only in Lviv.</p><p>Due to the rich cultural programme, developed infrastructure (now Lviv has more than 8 000 hotel rooms, over 700 caffees and restaurants, free WI-Fi zones in the city centery, good connection with many countries of the world) Lviv has the biggest tourist potential in Ukraine.</p><p>Lviv is also a huge educational center with 23 educational institutions, 7 of which prepares support staff for tourism infrastructure.</p><p>According to the statics, more than 10 thousand tourists come to each city festival.</p><p>Lviv has established many city-feasts, such as Coffee and Chocolate feasts, the feast of pampukh, The Day of Batyar, such festivals as &ldquo;Ethnovyr&rdquo;, &ldquo;Krayina Mriy&rdquo;, international theatrical festival &ldquo;Golden Lion&rdquo;.</p><p>Lviv is the city, where festivals and concerts are being held every week.</p>', '', 'full_html'),
('node', 'city', 0, 78, 78, 'und', 0, '<p>Odesa is a very special city since it&rsquo;s foundation. It was always the mixture of the lot of nationalities, for example, at the present more than 1.000.000 people represent 135 nations from all around the World! Such a mixture was the reason that made this city became very cosmopolitan, where each guest is always welcome and people are friendly and simple. There are also very undertaking and businesslike, creative and practical.</p><p>The fact that Odessa is located at the Black Sea shores made it very attractive as the vacation place still since its foundation at 1794. The Sea Port is located at the central part of the city, but aside of the Port there is a long line of beaches that length at its both sides to the end of this big city.</p><p>Since a lot of guests traditionally were coming to this city for vacation, Odesa developed a huge tourist infrastructure, restaurants, discos, night clubs, hotels, theaters, etc.</p><p>Where all these people stay when they come to Odesa? Since Soviet times Odesa had a few hotels of the questionable quality and services. However since 1991 when Ukraine started the new way of life, things has been changed dramatically. New big and small hotels of different classes were built as well as private apartments rent business developed extensively.</p><p>Odesa is not only an ideal place to rest, but it is also a city rich in natural and cultural resources. The best way to familiarize oneself with Odesa&rsquo;s splendid architecture, breathtaking views and fantastic monuments is by walking around its historic center. Odesa is a city that is not easily forgotten. Its snow-white yachts, golden beaches, lush green gardens, and the bluest waters, cling to the heart and fill each visitor with an overwhelming desire to return to the beautiful Odesa.</p>', '', 'full_html'),
('node', 'city', 0, 79, 79, 'und', 0, '<p>The history of Kharkiv city has almost 360 years and you can`t say it`s not enough. Rumor has it city started from phenomena of Wild Field or Dike pole where nomads lived for long time before Catherine II ordered to found the city of Kharkiv. There are few variants of the city name origin. One of it says Kharkiv was named on behalf Cossack Kharko, and his monument is standing on Lenin Avenue &ndash; one of the main streets. The other one is more reliable and says the city was named for the river &ndash; the name was given by Tatar tribes &ndash; and really the name of river Kharkiv found on maps of the Russian Empire long before the founding of the city.</p><p>A lot of water has flow under the bridge and Kharkiv has grown to second biggest city in Ukraine and even for few years it was the first capital of Ukrainian Soviet Republic. Today it is a very special place&nbsp; beautiful in its own way &ndash; it is also known as cradle of architectural style constructionism and it`s monumental grey buildings set the rhythm to central streets. Thus the city is not grey &ndash; it has variety of thousand shades and colors creating a unique image.</p><p>Kharkiv is a city of youth because here is the largest concentration of educational institutions &ndash; 69 universities, institutes, academies and colleges, where more than 200,000 students are studying. They are giving huge positive vibes of energy and emotions and thanks to it our city is growing and moving faster and faster.</p><p>There are thre points to must visit:</p><p>The fisrt one:&nbsp;<strong>Pokrovsky Monastery</strong>&nbsp;was founded right after the city. On its territory you can visit Pokrovska and Ozeryanska church, and few associated buildings &ndash; bishop`s house, monk`s cells, Icon shop and little bakery with monastery goods. NB: women should wear skirts and cover the head with some cloth &ndash; can be taken in monastery security, men shouldn`t wear shorts.</p><p>The second one:&nbsp;<strong>Svobody square</strong>&nbsp;is one of the biggest squares in Europe and definitely the biggest in Ukraine was founded in 1923 few moments before start of constructing the main symbol of Kharkiv &ndash; the Gosprom of Derzhprom building. Today the place is never empty &ndash; city celebrations and concerts, fairs and markets, children playgrounds in summer. To feel the spirit of central point of the city is best while there`s something going on it &ndash; would it be a Victory parade on 9<sup>th</sup>&nbsp;of May or show of &ldquo;Queen&rdquo; which gathered in one place more than 350 thousand people&nbsp; and it was a record number for the group.</p><p>And the third one:&nbsp;<strong>Architect&rsquo;s square</strong>&nbsp;is situated alongside Pushkinskaia street next to Architectora Beketova station and here there are a few focuses of attention. One of them without any doubts is collection of Seven Wonders of Kharkiv &ndash; miniature copies of Kharkiv&rsquo;s outstanding buildings and monuments. Here are also the Fountain of Lovers and an Oak which is growing here for two hundred years.</p>', '', 'full_html'),
('node', 'city', 0, 80, 80, 'und', 0, '<p>Dnipropetrovsk is spread across both banks of the great Dnieper River, and is one the most colorful and interesting cities of eastern Ukrainian. In addition to being the largest industrial and economic center, it has the status of being Ukraine&rsquo;s space capital, and it is an extremely charming city, attracting visitors with its beautiful architecture, numerous parks, picturesque boardwalks, and precious historical memorials.</p><p>Dnepropetrovsk&rsquo;s history began in 1776, when Catherine the Great (on a trip through the region) ordered general Gregory Potiomkin to establish a city here. However, the city&rsquo;s construction did not begin until 1787. The building of the Transfiguration Cathedral started at the same time, when the empress herself set the first stone in the structure&rsquo;s foundation. The town, originally named Yekaterinoslav, was intended to become Russian Empire&rsquo;s third main city. But these plans were not to be: after Catherine the Great died, the city&rsquo;s construction and development slowed down considerably.</p><p>The city&rsquo;s fortunes changed only in the late 19th century, when Yekaterinoslav prospered, as large ores deposits were discovered and a railroad was built nearby. Soon, it became one of the Russian Empire&rsquo;s most important industrial centers. In 1926, Yekaterinoslav was renamed into Dnepropetrovsk: its new name was a combination of the Dnieper River and the name of the Soviet official Grigory Petrovsky.</p><p>Modern Dnipropetrovsk&nbsp;easily weaves together the rhythm of a fast-paced business center with the peaceful atmosphere of countless parks, in which local residents like to spend their time. But the most popular place to walk and rest is the beautiful Lenin Boardwalk, which happens to be the longest in Europe. It leads to most one of the most interesting of the city&rsquo;s landmarks, the legendary Monastyrsky Island. It is well established that in the 9th century, a Byzantine monastery stood here (which explains the island&rsquo;s name). At that time, a famous trade route between the Varangians and the Greeks passed through the Dnieper River, and the island was often used as a stopping point. The Old Russian princess Olga once waited for a storm to pass in a local monastery; and shortly after that, the prince Vladimir the Great rested within its walls. Today, Monastyrsky Islandis part of the largest park of &nbsp;Dnipropetrovsk -Shevchenko Park. In the park is a cableway, from which you can get amazing views of the city and the splendid St. Nickolay Church. The park is so splendid, that even the pedestrian bridge leading to the island is considered to be a landmark of its own.</p><p>Dnipropetrovsk&nbsp;main road, the Karl Marx Avenue, beckons visitors with its beautiful structures that have survived since the 19th century. Among them, the most notable are the buildings of the National University, the City Duma (Parliament) and the English Club, as well as the famous History Museum&nbsp;- one of the oldest in Ukraine. It is famous all over Ukraine for its impressive collection of antiquities and artifacts, which number over seven thousand. In the museum, a diorama called &quot;Battle of Dnieper,&quot; which recounts the events of World War II, will attract your attention, as will the collection of ancient stone sculptures, one of the largest and most impressive in the world. The age of some of sculptures goes back up to five thousand years!</p><p>The architectural pride of Dnipropetrovsk&nbsp;is rightly considered to be the Transfiguration Cathedral, the same one that has been there since the beginning of the city&rsquo;s history. The architect wanted for Dnepropetrovsk&rsquo;s church to exceed Rome&rsquo;s St. Peter&#39;s Cathedral in size. Even though the idea was not fulfilled, the Transfiguration Cathedral is still an incredible sight to see, due to its stern splendor and understated beauty. Today, it is not only one of the most breathtaking cultural buildings in the city, but is also its spiritual center.</p><p>Dnipropetrovsk attracts with its great harmony. Two centuries-old classical buildings stand comfortably next to modern &quot;high tech&quot; buildings. And the severity of industrial giants is subdued by the rich greenery of picturesque parks and boulevards. All of that, along with a unique historical and cultural heritage, creates an inimitable atmosphere that makes Dnipropetrovsk&nbsp;unlike any other city in the country, and attracts thousands of travelers from all over the world.</p>', '', 'full_html'),
('node', 'city', 0, 81, 81, 'und', 0, '<p><strong>Kiev is the&nbsp;capital of Ukraine with population of about 3 million citizens. It is situated on the Dnepr River and boasts architectural monuments that are recognized world treasures. Kiev is the largest cultural, scientific and industrial center of Ukraine, the place of religious pilgrimage and a very attractive tourist destination. Its beautiful landscapes, parks and gardens charm and captivate. Hospitable Ukrainians will be delighted to introduce Slavic culture to their foreign guests.&nbsp;</strong></p><p>Kiev is a city of invaluable historical and cultural monuments, a city of great events and outstanding people. Everyone will find there something especially interesting for himself.</p><p>The art and architecture of Kiev are considered world treasures. Many famous artists, poets and writers estimated the unique beauty of this city. The most renowned landmarks include: Cathedral of St. Sophia with outstanding mosaics and frescoes dating back to the 11th century; Kievo-Percherskaya Lavra featuring several monasteries and cathedrals; Golden Gate of Kiev, which date back to 1037; Ukrainian Baroque Church of St. Andrew; the magnificent 19th-century Cathedral of St. Vladimir; and many other attractions. Kiev is often referred to as &quot;the mother of all cities&quot; by Russians and Ukrainians. It is one of the oldest towns in Europe. In the historical center of Kiev you can feel the spirit of the past everywhere.</p><p>Kiev is distinguished for its rich cultural life. Theater lovers will find many theatres offering various theatrical programs. Most performances are held in Ukrainian or Russian. The recently renovated Kiev Opera House presents very good opera as well as a broad repertoire of ballets. Ivan Franko Theater is a center of Ukrainian drama, comedy, and musicals. A lot of various exhibitions are carried out in the city&#39;s numerous museums and art galleries.</p><p>Kiev is also a scientific and educational center of independent Ukraine. Various universities and science academies including famous Kiev-Mogilyanskaya Academy, which is one of the first scientific establishments in Eastern Europe, are located there.</p><p>Being the largest city of Ukraine, Kiev is a leading industrial and commercial center of the country. Kiev&#39;s major industries include: food processing (especially processing of beet sugar), metallurgy, manufacture of machinery, machine tools, rolling stock, chemicals, building materials, and textiles. The development of Ukrainian economy gave impulse to business activity of the city. There are a lot of new office centers, banks, trade exhibition centers and other commercial enterprises appearing in the city nowadays.</p><p>Take a walk through the ancient streets of this scenic city, feel its unique beauty and the spirit of its past. For sure your stay in Kiev will become one of your most memorable experiences.</p>', '', 'full_html'),
('node', 'article', 0, 82, 82, 'und', 0, '<p>Bible school activities have been used in various regions to teach children and teenagers the Word of God. Whether it is inside a comfortable building or simply sitting on a tarp on the ground, children have been encouraged and taught about Jesus.</p>', '', 'full_html'),
('node', 'article', 0, 83, 83, 'und', 0, '<p>Constructions teams partner with a group or existing body of believers to build a new hall or make renovations. &nbsp;Usually, US partners help supply manpower and materials for the project. &nbsp;New construction creates excitement not only for the body but for the community as well.</p>', '', 'full_html'),
('node', 'article', 0, 84, 84, 'und', 0, '<p>Several unreached people groups in Ukraine are being told about the Good News for the first time. &nbsp;IMB personnel are working among some of the hardest to reach and unloved people in all of Europe. &nbsp;In these cities, IMB missionaries are partnering with locals in order to reach them.</p>', '', 'full_html'),
('node', 'article', 0, 85, 85, 'und', 0, '<p>US Medical teams have been used throughout Ukraine with great success in the sheer numbers reached. &nbsp;Clinics are set up in existing churches or rented halls. &nbsp;Every person seen in the clinic is prayed for, clearly given the Good News and sent home with a New Testament if they don&#39;t have one. &nbsp;Typically, a clinic sees more than 75 people a day.</p>', '', 'full_html'),
('node', 'article', 0, 86, 86, 'und', 0, '<p>IMB missionaries are involved in a variety of ministries throughout Ukraine. &nbsp;The main task is to support the work of partners and the ministries entrusted to them. &nbsp;These include: starting small groups in existing churches and as an impetus to starting new churches; disciple making through Training for Trainers, Experiencing God and other resources; training and evangelism.</p><p>IMB missionaries are always looking for US partners to join in ministry opportunities in order to strengthen the local church or group. &nbsp;Here are just a few of the many ministries a US partner church could join in the harvest fields of Ukraine:</p>', '', 'full_html'),
('node', 'article', 0, 87, 87, 'und', 0, '<p>The first identifiable groups to populate what is now Ukraine were Cimmerians, Scythians, Sarmatians, and Goths, among other nomadic peoples who arrived throughout the first millennium B.C. These peoples were well known to colonists and traders in the ancient world, including Greeks and Romans, who established trading outposts that eventually became city-states. Slavic tribes occupied central and eastern Ukraine in the sixth century A.D. and played an important role in the establishment of Kiev. Situated on lucrative trade routes, Kiev quickly prospered as the center of the powerful state of Kievan Rus. In the 11th century, Kievan Rus was, geographically, the largest state in Europe. Christian missionaries, Cyril and Methodius, propagated the Christian faith and the Cyrillic alphabet. Kievan Rus Prince Volodymyr converted the Kievan nobility and most of the population to Christianity in 988. Conflict among the feudal lords led to decline in the 12th century. Mongol raiders razed Kiev in the 13th century. Most of the territory of what is modern Ukraine was annexed by Poland and Lithuania in the 14th century, but during that time, Ukrainians began to conceive of themselves as a distinct people, a feeling that survived subsequent partitioning by greater powers over the next centuries. Ukrainian peasants who fled the Polish effort to force them into servitude came to be known as Cossacks and earned a reputation for their fierce martial spirit and love of freedom. In 1667, Ukraine was partitioned between Poland and Russia. In 1793, when Poland was partitioned, much of modern-day Ukraine was integrated into the Russian Empire. The 19th century found the region largely agricultural, with a few cities and centers of trade and learning. The region was under the control of the Austro-Hungarian Empire in the extreme west and the Russian Empire elsewhere. Ukrainian writers and intellectuals were inspired by the nationalistic spirit stirring other European peoples existing under other imperial governments and were determined to revive Ukrainian linguistic and cultural traditions and reestablish a Ukrainian state. Taras Shevchenko (1814-1861), national hero of Ukraine, presented the intellectual maturity of the Ukrainian language and culture through his work as a poet and artist. Imperial Russia, however, imposed strict limits on attempts to elevate Ukrainian culture, even banning the use and study of the Ukrainian language. When World War I and the Russian revolution shattered the Habsburg and Russian empires, Ukrainians declared independent statehood. In 1917 the Central Rada proclaimed Ukrainian autonomy and in 1918, following the Bolshevik seizure of power in Petrograd, the Ukrainian National Republic declared independence under President Mykhaylo Hrushevsky. In 1919, amid great fanfare, the Ukrainian People&#39;s Republic, led by journalist Simon Petliura, formally united with the West Ukrainian People&#39;s Republic (which was part of the Austro-Hungarian Empire) based in Lviv. This union of Ukraine&#39;s lands proved to be short lived as the West Ukrainian National Government&#39;s Army lost the war against Polish expansionists, while the Kiev- based Ukrainian Army was forced out of Ukraine by the Red Army. Soon after, Ukraine was officially incorporated into the Soviet Union. Under Stalin, rule Ukrainian political, social, economic and cultural fabric was atomized through totalitarian terror, involving massive purges, executions, and the exile of millions to the infamous labor camps of Siberia, Gulag. During World War II, Kiev again was heavily damaged. For 72 days the city was defended by its citizens and Soviet troops against the invading Nazis. On September 19, 1941, Nazi troops entered Kiev. The Nazis also built two concentration camps for civilians and POW&#39;s near Kiev. During this period, over 200,000 people were killed and over 100,000 were deported to Germany for forced labor. Kiev was liberated on November 6,1943, by So were deported to Germany for forced labor. Kiev was liberated on November 6,1943, by Soviet troops. Soon after celebrating the defeat of Hitler&#39;s Germany, Ukraine learned that &quot;liberation&quot; by the Soviet Army meant a different kind of dictatorship. The post war years in Kiev were marked by intensive restoration of the damage caused during the war. The city began to dress its wounds. Politically, however, new waves of Stalinist terror again tore at the Ukrainian social fabric, with more purges, executions, and mass exiles to the Gulag. As the worst features of the Stalinist police state began to dissipate during Khrushchev&#39;s and Brezhnev&#39;s leadership, the Kremlin intensified its policy of &quot;Russification&quot;, barring the Ukrainian language from government, education, courts and so on, pursuant to the theory that the &quot;Soviet peoples&quot; would become better unified if they adopted the Russian language and culture. With so many economic and social disincentives at work, the policy itself worked amazingly well, and new habity, especially in Kiev and other large cities of central and eastern Ukraine, deported to Germany for forced labor. Kiev was liberated on November 6,1943, by Soviet troops. Soon after celebrating the defeat of Hitler&#39;s Germany,Ukraine learned that &quot;liberation&quot; by the Soviet Army meant a different kind of dictatorship. The post war years in Kiev were marked by intensive restoration of the damage caused during the war. The city began to dress its wounds. Politically, however, new waves of Stalinist terror again tore at the Ukrainian social fabric, with more purges, executions, and mass exiles to the Gulag. As the worst features of the Stalinist police state began to dissipate during Khrushchev&#39;s and Brezhnev&#39;s leadership, the Kremlin intensified its policy of &quot;Russification&quot;, barring the Ukrainian language from government, education, courts and so on, pursuant to the theory that the &quot;Soviet peoples&quot; would become better unified if they adopted the Russian language and culture. With so many economic and social disincentives at work, the policy itself worked amazingly well, and new habity, especially in Kiev and other large cities of central and eastern Ukraine. The 1980&#39;s were marked by increasing political impotence of Soviet leadership. The Chernobyl Nuclear Power Plant accident of April 26,1986, brings back painful memories for all Ukrainians. This disaster caused tens of thousands of deaths and health related problems, and inflicted enormous ecological and economic damage. Chernobyl served to rock the Communist Party establishment with political fallout as the facts behind bureaucratic ineptitude, negligence, disregard for the ordinary citizens, and cover-up emerged and began to stir the minds of the people. On July 6, 1990, the legislature proclaimed Ukraine&#39;s sovereignty. In August 1991, a failed three-day military coup of the Kremlin&#39;s would-be dictators led to the Declaration of Independence by the Verhovna Rada (Parliament) on August 24. On December 1, in a nationwide referendum, 93% of Ukraine&#39;s citizens voted for an independent Ukraine and chose Leonid Krawchuk, former communist ideologist, as their first democratically elected President. On July 10, 1994, Leonid Kuchma, former director of the world&#39;s biggest rocket plant, defeated Leonid Krawchuk to become the second President of independent Ukraine. 1 UAH - Vladimir the Great (Grand Prince of Kiev, first started Christianity in Kievan Rus) 2 UAH - Yaroslav the Wise (Kyiv Prince) 5 UAH- Bogdan Khmelnitsky (public and politician, head of the Cossack state) 10 UAH - Ivan Mazepa (public and politician, head of the Cossack state) 20 UAH - Ivan Franco (writer, poet, social and political activist) 50 UAH - &nbsp;Mykhailo Hrushevsky (politician) 100 UAH - Taras Shevchenko (poet, writer, painter, social and political activist)<br />200 UAH - Lesya Ukrainka (writer and cultural figure) 500 UAH - Hryhorii Skovoroda (philosopher, educator, poet)</p>', '', 'full_html'),
('node', 'article', 0, 88, 88, 'und', 0, '<p>Ukraine is the second largest country in Europe. It is located between Poland and Russia. It is slightly smaller than the state of Texas. Much of the southeastern part of the country borders the Black Sea.</p><p>Most of Ukraine&#39;s land is made up of fertile plains, or steppes, and plateaus. Mountains are found only in the west and extreme south in the Crimean Peninsula. This area&#39;s climate is subtropical. Winters vary from cool along the Black Sea to cold farther inland. The temperature inland ranges from 66&deg;F in July, to 21&deg;F in January. Northern and western Ukraine average 27 inches of rainfall a year. This temperate climate is ideal for growing crops.</p><p>In fact, more than 57 percent of the Ukraine&#39;s fertile soil is suitable for growing such crops as sugar beets, wheat, and potatoes. The earliest known farmers in the Ukraine were the Trypillians (4500&ndash;2000 B.C. ). The territory of the Ukraine had rich soil and a favorable climate perfect for cultivating crops. The Trypillians grew barley, millet, rye, and wheat. They also herded sheep, pigs, and cattle. Wheat was plentiful, and soon trading routes were established along Ukraine&#39;s Black Sea coast to market the grain. The Ukraine territory became the crossing road connecting Arabia, Europe, and Asia. Life depended on the activities of cultivating soil for crops. In pre-Christian times, holidays were celebrated during times of transition from one type of agricultural activity to another. These seasonal festivities were later incorporated into Christian holidays, such as Christmas and Easter.</p><p>Over time, Ukraine fell under the power of many different countries, including Poland, Austria, and Russia. Despite being under Russian domination for almost 200 years, (gaining independence only in 1991), Ukrainians proudly kept their native traditions, customs, and cuisine. Kovbasa (sausage) and sauerkraut have Polish origins. Varnyky (dumplings) and holubtsi (stuffed cabbage) were originally imported from Turkey. Strudels, breaded meats, and desserts, such as cheesecake and tarts, were carried over from Austro-Hungarian times. Although Ukrainian dishes have origins from different countries, how they are prepared are uniquely Ukrainian.</p><p>In Ukrainian cuisine, when the dough isn&#39;t baked, it is usually boiled, such as kasha (hot cereal), or fried in the form of dumplings or fritters. Freshly made dumplings called varenyky are a common Ukrainian staple. Varenyky is dough stuffed with a variety of foods, such as potatoes, meats, cheeses, sauerkraut, and even fruit, such as blueberries or cherries, for dessert. Each region, restaurant, and family has its own recipe. The foothills of the Carpathian Mountains, located in the western Ukraine, provide pastures for grazing beef and dairy cattle. Meats, such as kovbasa (sausage), poultry, and pork are important to the Ukrainian diet. Pork is considered the national meat and pork fat is often used in cooking. It is used mostly for frying, but also can be eaten smoked or with salt. Common dairy products include milk, syrnyky (cottage cheese fritters), nalynsnyk (cheese-filled crepes), and riazhanka (fermented, baked milk). Desserts are often baked into sweet breads, cakes, and cookies, and made with honey and fruits, such as plums, blueberries, and cherries.</p><p>In general, Ukrainians eat a light breakfast. It can be bread with butter served with coffee or tea, or pastries, such as a cream-filled blintz. Kasha (cereal), steamed buckwheat, barley, or millet with milk may also be served. Their main meal is eaten around mid-afternoon and usually consists of soup, such as borshch and a dish with meat or poultry. The third meal of the day takes place around 6 or 7 p.m. It is usually a time when all family members get together. Eating at a restaurant is considered a luxury, and is usually not done very often. Ukrainians eat with a fork in their left hand and a knife in their right hand. It is considered impolite to hold your hands under the table during dinner, or to put your elbows on the table. In order not to seem wasteful, Ukrainians may eat everything on their plates. When they are visiting, Ukrainians may ask for second helpings to show appreciation for the food. Hosts often give guests a loaf of bread with salt on top, a tradition that dates back many centuries. Bread and salt were once considered necessary ingredients for health. The bread represents hospitality and the salt represents friendship.</p>', '', 'full_html'),
('node', 'news', 0, 89, 89, 'und', 0, '<p>DROPETROVSK, Ukraine &ndash; My love affair with Ukraine started more than 20 years ago. God first called me to the former Soviet Union in 1992, and I moved to Lugansk, Ukraine, in February 1994.</p><p>IMB missionary Tom Long has lived in and out of Ukraine for 20 years, with much of the last four years in Donetsk. The recent unrest has caused him to relocate to Dnepropetrovsk. Please join him in praying for Donetsk and Ukraine.</p><p>Read more YouReports.<br />In those early years, I saw lots of growth numerically in believers and church starts. Sure there were difficulties, like standing in line to purchase bread. However, seeing people who lived under communism for 70 years stepping forward to live in Christ was worth every hardship encountered.</p><p>After three years I returned to the U.S. to attend seminary, and eventually went back to Ukraine in September 2003 with the International Mission Board. Life had dramatically changed in the six years I was gone. Unfortunately, church growth was slowing in the midst of prosperity.</p><p>Four years ago I moved to Donetsk in the heart of the industrial belt. Trying to plant churches in eastern Ukraine had always been difficult, but God blessed me with a group of young people who had the same desire. Last fall, we moved into a rented hall and were averaging 20 people in the worship service. We made plans to start new groups.</p><p>But in February 2014, Ukraine&rsquo;s president left office. His departure set off a series of events that turned our world upside down and led me to leave Donetsk in April. War came to the city in late May and dispersed the church members to Russia and all over Ukraine.</p><p>By mid-June I knew I would not be returning to Donetsk. I would go to Dnepropetrovsk instead. It would be my fifth move in 11 years &mdash; a move I really didn&rsquo;t want to make, yet a move I knew I had to make.</p><p>Since I left Donetsk, God has been teaching me much about loving Him with all my heart, soul, mind and strength and loving my neighbor as myself. What does it mean to love my neighbors? Surely God doesn&rsquo;t mean those neighbors who caused me to flee my apartment, my life, the city I loved. Or does being a Christ follower mean I must love even those neighbors?</p><p>I&rsquo;ve seen examples of several pastors loving these neighbors in the conflict zone. One brother shared with me that during the height of the war their church housed more than 70 people and fed many more. This pastor could be retired, yet he stayed and served others. He told me he couldn&rsquo;t leave; it was his duty to stay. Because the church&rsquo;s doors have been open, they have seen numerous people from the neighborhood repent.</p><p>A second pastor and his family have stayed right in the midst of the war. Their church serves food to their neighbors. He drives outside the conflict zone so he can get money and food. His family, along with a few church members who stayed behind, prepares the meals for those who don&rsquo;t have any resources for purchasing food. Through this ministry, the church has seen people more interested in hearing the Gospel, and some have put their faith in Jesus.</p><p>Another pastor recently challenged me to pray a list of Scriptures back to the Lord and to substitute my name for the pronouns. So as I sat in the park on a beautiful Saturday afternoon, I prayed John 13:34, &ldquo;A new commandment you gave to Tom, that Tom loves one another: just as you have loved Tom, Tom also is to love one another.&rdquo;</p><p>A clear picture came to me of what the Lord intended in this verse. It doesn&rsquo;t matter where I live, whether in Texas, Donetsk or Dnepropetrovsk. If I am going to be His disciple, I must love.</p>', '', 'full_html'),
('node', 'news', 0, 90, 90, 'und', 0, '<p>SLAVYANSK, Ukraine (BP) &mdash; Cities in eastern Ukraine once held by pro-Russian separatists are slowly returning to normal as residents begin to rebuild their war-torn lives.</p><p>NATASHA&rsquo;S APARTMENT<br />IMB workers Tom Long* and Joy Burnett* tell of visiting a home destroyed by war in the eastern Ukrainian city of Slovyansk - a city once held by pro-Russian separatists. (*Name changed.)</p><p>&ldquo;I am still trying to process what I saw,&rdquo; Burnett said from her home in Kharkiv, an eastern Ukrainian city spared by the war. &ldquo;I could feel the tears rising in my throat, but they just haven&rsquo;t come yet. I was impacted deeply, but I just haven&rsquo;t let those feelings come to the surface yet.&rdquo;</p><p>Burnett and Long spent their day touring the city and visiting with church leaders, as well as a children&rsquo;s home and the apartment of a woman who lost her home as a result of the attacks on the city.</p><p>Long said there are many needs in Slovyansk and other towns that had been occupied but are now liberated.</p><p>&ldquo;Most of these people depend on the food from their summer garden to get them through the winter,&rdquo; he said. &ldquo;But the city was under siege from April to July, so there is no food from the gardens.&rdquo;</p><p>Long added that food for the winter months is just one of many needs residents will have as they begin to rebuild their cities and their lives.</p><p>&ldquo;It&rsquo;s not like you drive into the city and there are huge buildings that are flattened or missing. But there were many buildings that were damaged. Many have holes in the roofs or walls of the building,&rdquo; he said. &ldquo;And if we are going to help these folks be able to get through the winter, we need to begin working soon.&rdquo;</p><p>Long and Burnett are working alongside Baptist Global Response (BGR) to help Southern Baptists mobilize relief efforts in eastern Ukraine. &ldquo;Southern Baptists always rise to the occasion,&rdquo; Long said. &ldquo;And I know they will do the same here.&rdquo;</p><p>Consider partnering or donating to show God&#39;s love to Ukrainians who need help to &nbsp;repair homes and broken lives.</p>', '', 'full_html'),
('node', 'news', 0, 91, 91, 'und', 0, '<p>KHARKIV, Ukraine &mdash; &ldquo;Our city is under God&#39;s wing of protection,&quot; Nadia said.<br />She said she feels it when she goes to the main square of Kharkiv each morning to pray for her city and for Ukraine.<br />The eastern Ukrainian city, located just 20 miles from the Russian border, was expected to be one of the first to fall to pro-Russian separatists.But even though major cities in neighboring areas are controlled by separatists and embroiled in bloody battles, today Kharkiv remains peaceful and residents say public demonstrations on both sides have all but subsided.</p><p><br />For more than 130 days, believers in Kharkiv have started each morning on their knees. They believe God has honored their prayers. &ldquo;This is not about us,&rdquo; Nadia said. &ldquo;It is not about our prayers. But God has been faithful to hear our prayers and to keep our city peaceful and safe.&rdquo;<br />The Kharkiv &ldquo;prayer circle&rdquo; began at the onset of the EuroMaidan revolution in Kiev. Started by a small group of evangelical believers &mdash; mostly Baptist &mdash; the group has grown and some days swells to nearly 200 people.</p><p><br />Joy Burnett*, an International Mission Board worker based in Kharkiv, said the group has been faithful to meet regardless of weather or other conflicting factors.<br />&ldquo;In the days between the Maidan revolution and when violence broke out in the east, we were not sure what would happen here in Kharkiv,&rdquo; Burnett said. &ldquo;There was lots of fear and uncertainty.&rdquo;</p><p><br />And for a time Burnett left the city as tensions between pro-Russian separatists and the Ukrainian army rose.<br />&ldquo;I really missed being with the group during that time,&rdquo; Burnett said. &ldquo;I may have been living somewhere else, but at 7 o&rsquo;clock each morning my heart was always with my brothers and sisters in Kharkiv. I really wanted to be with them on the square praying.&rdquo;<br />Nadia said she believes this time of prayer each day is very special and different from the prayer times they have in their church.<br />&ldquo;It is a privilege for us to kneel here praying [to] Him,&rdquo; she said. &ldquo;There is something special about when we pray outdoors. Heaven touches earth when we pray here (under the open sky).&rdquo;</p><p><br />As time has passed, not only has the group grown, it also has become multi-confessional as well. They say it is not uncommon for Baptists to be praying alongside Ukrainian Orthodox, Pentecostals and even Messianic Jewish believers.<br />&ldquo;There were always barriers between us in the past,&rdquo; Nadia said. &ldquo;But now those barriers are much less. We greet each other in the love that comes with being fellow believers, and we pray openly with each other. It is very sweet.&rdquo;<br />Victoria, a Kharkiv native who is studying at an American university, returned to Ukraine to spend the summer with her family. She and other students regularly attend the morning prayer meetings.</p><p><br />She believes the daily gathering is a great witness to non-Christians who pass by every day on their way to work. &ldquo;They see us praying here,&rdquo; she said, &ldquo;and they understand that we believe in something that is bigger.&rdquo;<br />Nadia added, &ldquo;These students understand that they are fighting for their future on their knees.&rdquo;<br />When the group began praying together they thought it would last only a few weeks. Now, more than six months later, many like Nadia hope they will continue meeting daily to pray &mdash; even after the conflict ends.<br />&ldquo;I would like to come here every morning,&rdquo; she said. &ldquo;Maybe even until the Lord returns.&rdquo;</p>', '', 'full_html'),
('node', 'article', 0, 92, 92, 'und', 0, '<p>Many of its ethnic groups living within Ukraine have their own&nbsp;<strong>unique musical traditions</strong>.</p><p>The most striking general characteristic of authentic ethnic Ukrainian folk music is the wide use of minor modes. Ritual songs of Ukraine are frequently in recitative style, essentially monodic. For example, Shchedrivka &quot;Shchedryk&quot; known in the West as &quot;Carol of the Bells&quot;.</p><p>The bulk of Ukrainian folk songs melodies are based on scales identical to mеdieval modes, but differ in melodic structure. Ukrainian vocal music exhibits a wide variety of forms &ndash; monodic, heterophonic, homophonic, harmonic and polyphonic. Ukrainian folk song singing style can be divided into a number of broad aesthetic categories: Solo singing - primarily ritual songs including holosinnya (sung at wakes). Solo singing with instrumental accompaniment of the bandura, kobza, or lira by professional singers known as kobzari, or lirnyky.</p><p>The highest form of development of this style of singing can be seen in the lyric historical folk epics known as dumy. Archaic type of modal &quot;a cappella&quot; vocal style in which a phrase sung by a soloist is answered by a choral phrase in two, or three, voice harmony. Traditional Ukrainian instruments are: kobza (lute), bandura, violin, basolya (3-string cello), lira (hurdy-gurdy), tsymbaly, sopilka (duct flute), trembita (alpenhorn), fife, volynka (bagpipes), buben (frame drum), tulumbas (kettledrum), resheto (tambourine) and drymba / varhan (Jaw harp). Troyisti muzyky are traditional instrumental ensembles of Ukraine. Literally it means &quot;three musicians&quot; who typically make up the ensemble, for example, violin, sopilka and buben.</p><p>&nbsp;</p><p><strong>Traditional dances of Ukraine are</strong>: Kozak, Kozachok, Hopak, Hrechanyky, Tropak, Kolomyjka and Hutsulka, Shumka, Arkan, Metelytsia, Kateryna (Kadryl) and Chabarashka. There are also dances originating outside Ukraine, but which are quite popular: Polka, Krakowiak, Mazurka, Barynya, Csárdás, Waltz and Kamarynska. Ukrainian instrumental and dance music has also influenced Jewish and Gypsy music.</p><p>The first professional music academy was set up in Hlukhiv, Ukraine in 1738 where students were taught to sing, play violin and bandura from manuscripts. As a result, many of the earliest composers and performers within the Russian empire were ethnically Ukrainian, having been born, or educated, in Hlukhiv, or had been closely associated with this music school. Ukrainian national school of classical music was spearheaded byMykola Lysenko. This school includes such composers as Mykola Leontovych, Kyrylo Stetsenko andLevko Revutsky. Most of their music contains Ukrainian folk figures and are composed to Ukrainian texts. There are also many famous composers and performers of non-Ukrainian ethnicity who were born, or at some time were citizens, or were active in Ukraine. Among them are: Franz Xavier Mozart, Rheinhold Gliere,Isaak Dunayevsky, Sergei Prokofiev and Yuliy Meitus. Among famous performers are Volodymyr Horovyts, Sviatoslav Richter, David Oistrakh and Isaac Stern. The music of these composers rarely contains Ukrainian folk motives and are more often written to the texts of Russian, or Polish poets.</p>', '', 'full_html');
