('node', 'article', 0, 93, 93, 'und', 0, '<p>The traditional dress of Ukraine is a centuries old unique and distinctive emblem of the Ukrainian culture. This dress has developed after the tremendous variation due to its association with the early Slavonic domination, during which many materials were introduced by the cloth merchants. The traditional dress of Ukraine is also full of ornamental designs, fantastic embroidery and remarkable exposition. Even today, the national dress of Ukraine is hand woven and fabulously decorated. The embroidery is an ancient practice which is applied to the traditional dress of Ukraine and it is varied from region to region in the country, embellished with the antiquated motifs and harmonic arrangements full of colors and exotic stitches.</p><p>The traditional dress for men in Ukraine was normally made with sheepskin and leather which was also decorated with embroidery and cords, tassels, and other accessories. The men also wore Kontusz, a long robe, usually reaching to below the knees, with a set of decorative buttons down the front. The elite and noble Ukrainian men also used a long garment, which was known as Zupan. Similarly, a traditional pant was also used, known as Sharovary, which was free to hips, often with assembly at the waist, collected at the bottom near the ankle.</p><p>The traditional dress for women in Ukraine contains the ethnic embroidery and usually, it was made of homemade linen which was produced by loom. In the cold winters, Kozhushankas were worn which were prepared with the sheepskin coat. The coats varied in color from region to region. The edges of Kozhushankas were trimmed with black sheepskin or other differently dyed material. The married women used to wear Ochipok, which was a traditional headdress that covered the entire head with a slit in the back and laces that pull it tightly around the head. Similarly, Namitka is a long, thin fabric wrapped around the head and tied in the back.</p><p>The traditional dress of Ukraine for the unmarried girls is never completed without mentioning a circular head floral decoration. This is the Ukrainian flower wreath, which remains a part of the Ukrainian national attire, and is worn on festive occasions and on holy days. The fragrant flowers give the glamorous and refreshing touch to the costume. Nowadays, the folk dancers wear the flower wreath during their performances.</p><p>Another part and parcel of the traditional dress of Ukraine is the artistic and handmade jewelry usually made with glass beads using strong synthetic threads. Bead work is extremely popular in Carpathian Mountains area, but lots of artists make beaded jewelry in the cities of Lviv and Ternopil. Today, the ancient patterns are mixed with the modern stencils and the Ukrainian women love to wear these traditional ornaments on jeans and shirts.</p><p>The female footwear of the traditional dress of Ukraine was made of red and yellow leather, which was also used for decorating skins. The traditional dress of Ukraine also reflects the impressive history and behaviorism of the Ukrainian nation.</p><div>&nbsp;</div>', '', 'full_html'),
('node', 'article', 0, 94, 94, 'und', 0, '<p>As of January 1, 2013, Ukraine had 33,977 churches and religious organizations. Today more than 97% of the registered religious communities in Ukraine are Christian.</p><p>About half of them are Orthodox. The other half is split among Catholics and Protestants.</p><p>The category of &quot;traditional&quot; (in informal terminology) churches has three major Orthodox jurisdictions, the Ukrainian Greek Catholic Church, the Roman Catholic Church, the Armenian community, also, to some extent, the communities of Lutherans, Calvinists, Baptists, Pentecostals, and Adventists. The biggest church in terms of the number of registered communities in Ukraine is the Ukrainian Orthodox Church (for better understanding in relation to other registered churches in Ukraine it is sometimes followed by the abbreviation &quot;MP&quot; (Moscow Patriarchate), but this addition is not part of the official name of the church). Today, this denomination has 12,251 registered religious entities (including 11,952 communities).</p><p>The second largest registered community in Ukraine is the Ukrainian Orthodox Church of the Kyiv Patriarchate. Today it has 4,508 registered associations (of which 4,371 are communities) and 3,021 clergymen. The third largest Orthodox Church in Ukraine is the Ukrainian Autocephalous Orthodox Church, which has 1,227 registered religious associations (including 1,190 parishes), in which are serving 699 clergymen.</p><p>Ukraine also has 57 registered communities of the Russian Orthodox Old-Rite Church, which are united in the Kyivan Archeparchy, and 11 communities of Old Believers-bespopovtsy. There are also 33 communities of the Russian Orthodox Church Outside of Russia and 31 parishes of the Russian True Orthodox Church, and 101 Orthodox communities that belong to various small associations. In particular, there is a parish of the Romanian Orthodox Church, which is registered as the Autonomous Orthodox parish.</p><p>Ukraine also has two national Catholic Churches: the Ukrainian Greek Catholic Church and the Roman Catholic Church in Ukraine. The Ukrainian Greek Catholic Church is the largest Eastern Catholic Church in the world. In Ukraine, it has 3,825 registered organizations (3,646 parishes), in which 2,424 clergymen are serving. The Roman Catholic Church has 1,081 registered religious associations (including 909 parishes), in which 579 clergymen are serving.</p><p>Another community in Ukraine is the so-called Non-Caledonian, Armenian Apostolic Church, the community of which is in Kyiv, Lviv, Odesa, Kharkiv, Donetsk, Dnipropetrovsk, and a few cities in the Crimea.</p><p>Among the Protestant denominations, the most common in Ukraine is the All-Ukrainian Union of Evangelical Christian Baptists with 2,705 registered communities and the Ukrainian Union of Christians of Evangelical Faith-Pentecostals with 1,595 associations. In addition to these major denominations, there are many other Protestant and neo-Protestant communities.</p><p>In Ukraine, there are also representatives of several denominations of Judaism and Islam. At the end of 1980s neo-pagan communities appeared in Ukraine. The number of other religious and religious philosophical (Buddhism) trends, including non-traditional and new religious movements has been dynamically growing. Since December 1996 the All-Ukrainian Council of Churches and Religious Organizations (AUCCRO) operates; it unites about 90% of the religious communities in Ukraine.</p><p>Since late 2002 along with the AUCCRO operates the Council of Heads of Christian Churches of Ukraine, which includes representatives of several leading Christian denominations.</p>', '', 'full_html'),
('node', 'article', 0, 95, 95, 'und', 0, '<p>Religion in Ukraine has a somewhat different &quot;mix&quot; of faiths as compared to religion in Russia. Although the region was once home to rather large Muslim and Jewish communities, Islam and Judaism have diminished significantly from their historic heights.</p><p>Ukraine, unlike Russia, is predominately Christian, with greater than 90% of religiously active citizens belonging to Orthodox, Catholic or Protestant denominations (2006 Razumkov Centre survey). According to the same 2006 Razumkov Centre survey, the breakdown of religious faith in Ukraine is as follows.</p><p>- 14.9% belong to the Ukrainian Orthodox Church - Kiev Patriarchate not recognized by the Eastern Orthodox Communion uses Ukrainian and Slavonic as liturgical languages</p><p>- 10.9% belong to the Ukrainian Orthodox Church - Moscow Patriarchate jurisdiction of the Russian Orthodox Church has the largest number of churches in Ukraine claims up to 75% of the Ukrainian population (official website) uses predominately the Old Slavonic language for services</p><p>- 5.3% belong to the Ukrainian Greek Catholic Church practices Byzantine rites similar to Orthodox Christianity, but is united with the Roman Catholic Church formed in 1596 to unify Orthodox and Roman Catholic believers banned within the Soviet Union from 1946 to 1989 uses the Ukrainian language</p><p>- 1% belong to the Ukrainian Autocephalous Orthodox Church predominant in western Ukraine uses the Ukrainian language</p><p>- 0.9% are of Protestant denominations Pentecostal, Baptist, Lutheran, Mennonites, Adventists</p><p>- 0.6% belong to the Roman Catholic Church mostly Ukrainians of Polish ancestry from western Ukraine 0.2% adhere to Islam consist of indigenous Crimean Tatar, as well as Muslim immigrants from former Soviet states</p><p>- 0.1% practice Judaism</p><p>&nbsp;</p><p><strong>3.2%&nbsp;</strong>said they belong to &quot;other&quot; denominations</p><p><strong>62.5%</strong>&nbsp;stated they were not religious, or didn&#39;t belong to any particular religious denomination</p>', '', 'full_html');
