(77, 'node', ' lviv lviv a city in western ukraine is regarded as one of the main cultural centers of ukraine in 2009 it has been recognized as the cultural capital of ukraine on the 28th of april 2009 lviv has been recognized as the cultural capital of ukraine this status award was given based on expert research of the state service of tourism and resorts and the council on tourism and resorts issues the main reasons of such obtaining is the conducting of more than 100 festivals annually 60 museums 100 churches of different confessions and the big tourist interest in lviv for the past 2 years the tourist stream to the city increased by 40 and now it is more than a million people per year among the foreigners the biggest amount of tourists come from poland germany austria belarus usa and russia the city is known as a center of art literature music and theatre nowadays the indisputable evidences of the city cultural richness is a big number of theaters concert halls creative unions and also high number of many artistic activities temples frescos paintings traditions feasts festivals all these are the heirdom of the past and the product of the present geniuses which can be felt only in lviv due to the rich cultural programme developed infrastructure now lviv has more than 8  hotel rooms over 700 caffees and restaurants free wifi zones in the city centery good connection with many countries of the world lviv has the biggest tourist potential in ukraine lviv is also a huge educational center with 23 educational institutions 7 of which prepares support staff for tourism infrastructure according to the statics more than 10 thousand tourists come to each city festival lviv has established many cityfeasts such as coffee and chocolate feasts the feast of pampukh the day of batyar such festivals as ethnovyr krayina mriy international theatrical festival golden lion lviv is the city where festivals and concerts are being held every week geolocation is 49839683 24029717000000005  ', 0),
(78, 'node', ' odessa odesa is a very special city since it s foundation it was always the mixture of the lot of nationalities for example at the present more than 1000000 people represent 135 nations from all around the world such a mixture was the reason that made this city became very cosmopolitan where each guest is always welcome and people are friendly and simple there are also very undertaking and businesslike creative and practical the fact that odessa is located at the black sea shores made it very attractive as the vacation place still since its foundation at 1794 the sea port is located at the central part of the city but aside of the port there is a long line of beaches that length at its both sides to the end of this big city since a lot of guests traditionally were coming to this city for vacation odesa developed a huge tourist infrastructure restaurants discos night clubs hotels theaters etc where all these people stay when they come to odesa since soviet times odesa had a few hotels of the questionable quality and services however since 1991 when ukraine started the new way of life things has been changed dramatically new big and small hotels of different classes were built as well as private apartments rent business developed extensively odesa is not only an ideal place to rest but it is also a city rich in natural and cultural resources the best way to familiarize oneself with odesa s splendid architecture breathtaking views and fantastic monuments is by walking around its historic center odesa is a city that is not easily forgotten its snowwhite yachts golden beaches lush green gardens and the bluest waters cling to the heart and fill each visitor with an overwhelming desire to return to the beautiful odesa geolocation is 46482526 30723309500000028 odesit  ', 0),
(79, 'node', ' kharkiv the history of kharkiv city has almost 360 years and you can t say it s not enough rumor has it city started from phenomena of wild field or dike pole where nomads lived for long time before catherine ii ordered to found the city of kharkiv there are few variants of the city name origin one of it says kharkiv was named on behalf cossack kharko and his monument is standing on lenin avenue one of the main streets the other one is more reliable and says the city was named for the river the name was given by tatar tribes and really the name of river kharkiv found on maps of the russian empire long before the founding of the city a lot of water has flow under the bridge and kharkiv has grown to second biggest city in ukraine and even for few years it was the first capital of ukrainian soviet republic today it is a very special place beautiful in its own way it is also known as cradle of architectural style constructionism and it s monumental grey buildings set the rhythm to central streets thus the city is not grey it has variety of thousand shades and colors creating a unique image kharkiv is a city of youth because here is the largest concentration of educational institutions 69 universities institutes academies and colleges where more than 200000 students are studying they are giving huge positive vibes of energy and emotions and thanks to it our city is growing and moving faster and faster there are thre points to must visit the fisrt one  pokrovsky monastery  was founded right after the city on its territory you can visit pokrovska and ozeryanska church and few associated buildings bishop s house monk s cells icon shop and little bakery with monastery goods nb women should wear skirts and cover the head with some cloth can be taken in monastery security men shouldn t wear shorts the second one  svobody square  is one of the biggest squares in europe and definitely the biggest in ukraine was founded in 1923 few moments before start of constructing the main symbol of kharkiv the gosprom of derzhprom building today the place is never empty city celebrations and concerts fairs and markets children playgrounds in summer to feel the spirit of central point of the city is best while there s something going on it would it be a victory parade on 9 th of may or show of queen which gathered in one place more than 350 thousand people and it was a record number for the group and the third one  architect s square  is situated alongside pushkinskaia street next to architectora beketova station and here there are a few focuses of attention one of them without any doubts is collection of seven wonders of kharkiv miniature copies of kharkiv s outstanding buildings and monuments here are also the fountain of lovers and an oak which is growing here for two hundred years geolocation is 499935 36230383000000074 user  ', 0),
(80, 'node', ' dnipropetrovsk dnipropetrovsk is spread across both banks of the great dnieper river and is one the most colorful and interesting cities of eastern ukrainian in addition to being the largest industrial and economic center it has the status of being ukraine s space capital and it is an extremely charming city attracting visitors with its beautiful architecture numerous parks picturesque boardwalks and precious historical memorials dnepropetrovsk s history began in 1776 when catherine the great on a trip through the region ordered general gregory potiomkin to establish a city here however the city s construction did not begin until 1787 the building of the transfiguration cathedral started at the same time when the empress herself set the first stone in the structure s foundation the town originally named yekaterinoslav was intended to become russian empire s third main city but these plans were not to be after catherine the great died the city s construction and development slowed down considerably the city s fortunes changed only in the late 19th century when yekaterinoslav prospered as large ores deposits were discovered and a railroad was built nearby soon it became one of the russian empire s most important industrial centers in 1926 yekaterinoslav was renamed into dnepropetrovsk its new name was a combination of the dnieper river and the name of the soviet official grigory petrovsky modern dnipropetrovsk easily weaves together the rhythm of a fastpaced business center with the peaceful atmosphere of countless parks in which local residents like to spend their time but the most popular place to walk and rest is the beautiful lenin boardwalk which happens to be the longest in europe it leads to most one of the most interesting of the city s landmarks the legendary monastyrsky island it is well established that in the 9th century a byzantine monastery stood here which explains the island s name at that time a famous trade route between the varangians and the greeks passed through the dnieper river and the island was often used as a stopping point the old russian princess olga once waited for a storm to pass in a local monastery and shortly after that the prince vladimir the great rested within its walls today monastyrsky islandis part of the largest park of dnipropetrovsk shevchenko park in the park is a cableway from which you can get amazing views of the city and the splendid st nickolay church the park is so splendid that even the pedestrian bridge leading to the island is considered to be a landmark of its own dnipropetrovsk main road the karl marx avenue beckons visitors with its beautiful structures that have survived since the 19th century among them the most notable are the buildings of the national university the city duma parliament and the english club as well as the famous history museum one of the oldest in ukraine it is famous all over ukraine for its impressive collection of antiquities and artifacts which number over seven thousand in the museum a diorama called battle of dnieper which recounts the events of world war ii will attract your attention as will the collection of ancient stone sculptures one of the largest and most impressive in the world the age of some of sculptures goes back up to five thousand years the architectural pride of dnipropetrovsk is rightly considered to be the transfiguration cathedral the same one that has been there since the beginning of the city s history the architect wanted for dnepropetrovsk s church to exceed rome s st peter s cathedral in size even though the idea was not fulfilled the transfiguration cathedral is still an incredible sight to see due to its stern splendor and understated beauty today it is not only one of the most breathtaking cultural buildings in the city but is also its spiritual center dnipropetrovsk attracts with its great harmony two centuriesold classical buildings stand comfortably next to modern high tech buildings and the severity of industrial giants is subdued by the rich greenery of picturesque parks and boulevards all of that along with a unique historical and cultural heritage creates an inimitable atmosphere that makes dnipropetrovsk unlike any other city in the country and attracts thousands of travelers from all over the world geolocation is 48464717 3504618299999993 karl marx  ', 0),
(81, 'node', ' kyiv kiev is the capital of ukraine with population of about 3 million citizens it is situated on the dnepr river and boasts architectural monuments that are recognized world treasures kiev is the largest cultural scientific and industrial center of ukraine the place of religious pilgrimage and a very attractive tourist destination its beautiful landscapes parks and gardens charm and captivate hospitable ukrainians will be delighted to introduce slavic culture to their foreign guests  kiev is a city of invaluable historical and cultural monuments a city of great events and outstanding people everyone will find there something especially interesting for himself the art and architecture of kiev are considered world treasures many famous artists poets and writers estimated the unique beauty of this city the most renowned landmarks include cathedral of st sophia with outstanding mosaics and frescoes dating back to the 11th century kievopercherskaya lavra featuring several monasteries and cathedrals golden gate of kiev which date back to 1037 ukrainian baroque church of st andrew the magnificent 19thcentury cathedral of st vladimir and many other attractions kiev is often referred to as the mother of all cities by russians and ukrainians it is one of the oldest towns in europe in the historical center of kiev you can feel the spirit of the past everywhere kiev is distinguished for its rich cultural life theater lovers will find many theatres offering various theatrical programs most performances are held in ukrainian or russian the recently renovated kiev opera house presents very good opera as well as a broad repertoire of ballets ivan franko theater is a center of ukrainian drama comedy and musicals a lot of various exhibitions are carried out in the city s numerous museums and art galleries kiev is also a scientific and educational center of independent ukraine various universities and science academies including famous kievmogilyanskaya academy which is one of the first scientific establishments in eastern europe are located there being the largest city of ukraine kiev is a leading industrial and commercial center of the country kiev s major industries include food processing especially processing of beet sugar metallurgy manufacture of machinery machine tools rolling stock chemicals building materials and textiles the development of ukrainian economy gave impulse to business activity of the city there are a lot of new office centers banks trade exhibition centers and other commercial enterprises appearing in the city nowadays take a walk through the ancient streets of this scenic city feel its unique beauty and the spirit of its past for sure your stay in kiev will become one of your most memorable experiences geolocation is 504501 30523400000000038  ', 0),
(82, 'node', ' bible schools bible school activities have been used in various regions to teach children and teenagers the word of god whether it is inside a comfortable building or simply sitting on a tarp on the ground children have been encouraged and taught about jesus  ', 0),
(83, 'node', ' construction teams constructions teams partner with a group or existing body of believers to build a new hall or make renovations usually us partners help supply manpower and materials for the project new construction creates excitement not only for the body but for the community as well  ', 0),
(84, 'node', ' good news several unreached people groups in ukraine are being told about the good news for the first time imb personnel are working among some of the hardest to reach and unloved people in all of europe in these cities imb missionaries are partnering with locals in order to reach them  ', 0),
(85, 'node', ' medical clinic us medical teams have been used throughout ukraine with great success in the sheer numbers reached clinics are set up in existing churches or rented halls every person seen in the clinic is prayed for clearly given the good news and sent home with a new testament if they don t have one typically a clinic sees more than 75 people a day doctor  ', 0),
(86, 'node', ' ministry throughout ukraine imb missionaries are involved in a variety of ministries throughout ukraine the main task is to support the work of partners and the ministries entrusted to them these include starting small groups in existing churches and as an impetus to starting new churches disciple making through training for trainers experiencing god and other resources training and evangelism imb missionaries are always looking for us partners to join in ministry opportunities in order to strengthen the local church or group here are just a few of the many ministries a us partner church could join in the harvest fields of ukraine  ', 0),
(87, 'node', ' history the first identifiable groups to populate what is now ukraine were cimmerians scythians sarmatians and goths among other nomadic peoples who arrived throughout the first millennium bc these peoples were well known to colonists and traders in the ancient world including greeks and romans who established trading outposts that eventually became citystates slavic tribes occupied central and eastern ukraine in the sixth century ad and played an important role in the establishment of kiev situated on lucrative trade routes kiev quickly prospered as the center of the powerful state of kievan rus in the 11th century kievan rus was geographically the largest state in europe christian missionaries cyril and methodius propagated the christian faith and the cyrillic alphabet kievan rus prince volodymyr converted the kievan nobility and most of the population to christianity in 988 conflict among the feudal lords led to decline in the 12th century mongol raiders razed kiev in the 13th century most of the territory of what is modern ukraine was annexed by poland and lithuania in the 14th century but during that time ukrainians began to conceive of themselves as a distinct people a feeling that survived subsequent partitioning by greater powers over the next centuries ukrainian peasants who fled the polish effort to force them into servitude came to be known as cossacks and earned a reputation for their fierce martial spirit and love of freedom in 1667 ukraine was partitioned between poland and russia in 1793 when poland was partitioned much of modernday ukraine was integrated into the russian empire the 19th century found the region largely agricultural with a few cities and centers of trade and learning the region was under the control of the austrohungarian empire in the extreme west and the russian empire elsewhere ukrainian writers and intellectuals were inspired by the nationalistic spirit stirring other european peoples existing under other imperial governments and were determined to revive ukrainian linguistic and cultural traditions and reestablish a ukrainian state taras shevchenko 18141861 national hero of ukraine presented the intellectual maturity of the ukrainian language and culture through his work as a poet and artist imperial russia however imposed strict limits on attempts to elevate ukrainian culture even banning the use and study of the ukrainian language when world war i and the russian revolution shattered the habsburg and russian empires ukrainians declared independent statehood in 1917 the central rada proclaimed ukrainian autonomy and in 1918 following the bolshevik seizure of power in petrograd the ukrainian national republic declared independence under president mykhaylo hrushevsky in 1919 amid great fanfare the ukrainian people s republic led by journalist simon petliura formally united with the west ukrainian people s republic which was part of the austrohungarian empire based in lviv this union of ukraine s lands proved to be short lived as the west ukrainian national government s army lost the war against polish expansionists while the kiev based ukrainian army was forced out of ukraine by the red army soon after ukraine was officially incorporated into the soviet union under stalin rule ukrainian political social economic and cultural fabric was atomized through totalitarian terror involving massive purges executions and the exile of millions to the infamous labor camps of siberia gulag during world war ii kiev again was heavily damaged for 72 days the city was defended by its citizens and soviet troops against the invading nazis on september 19 1941 nazi troops entered kiev the nazis also built two concentration camps for civilians and pow s near kiev during this period over 200000 people were killed and over 100000 were deported to germany for forced labor kiev was liberated on november 61943 by so were deported to germany for forced labor kiev was liberated on november 61943 by soviet troops soon after celebrating the defeat of hitler s germany ukraine learned that liberation by the soviet army meant a different kind of dictatorship the post war years in kiev were marked by intensive restoration of the damage caused during the war the city began to dress its wounds politically however new waves of stalinist terror again tore at the ukrainian social fabric with more purges executions and mass exiles to the gulag as the worst features of the stalinist police state began to dissipate during khrushchev s and brezhnev s leadership the kremlin intensified its policy of russification barring the ukrainian language from government education courts and so on pursuant to the theory that the soviet peoples would become better unified if they adopted the russian language and culture with so many economic and social disincentives at work the policy itself worked amazingly well and new habity especially in kiev and other large cities of central and eastern ukraine deported to germany for forced labor kiev was liberated on november 61943 by soviet troops soon after celebrating the defeat of hitler s germany ukraine learned that liberation by the soviet army meant a different kind of dictatorship the post war years in kiev were marked by intensive restoration of the damage caused during the war the city began to dress its wounds politically however new waves of stalinist terror again tore at the ukrainian social fabric with more purges executions and mass exiles to the gulag as the worst features of the stalinist police state began to dissipate during khrushchev s and brezhnev s leadership the kremlin intensified its policy of russification barring the ukrainian language from government education courts and so on pursuant to the theory that the soviet peoples would become better unified if they adopted the russian language and culture with so many economic and social disincentives at work the policy itself worked amazingly well and new habity especially in kiev and other large cities of central and eastern ukraine the 1980 s were marked by increasing political impotence of soviet leadership the chernobyl nuclear power plant accident of april 261986 brings back painful memories for all ukrainians this disaster caused tens of thousands of deaths and health related problems and inflicted enormous ecological and economic damage chernobyl served to rock the communist party establishment with political fallout as the facts behind bureaucratic ineptitude negligence disregard for the ordinary citizens and coverup emerged and began to stir the minds of the people on july 6 1990 the legislature proclaimed ukraine s sovereignty in august 1991 a failed threeday military coup of the kremlin s wouldbe dictators led to the declaration of independence by the verhovna rada parliament on august 24 on december 1 in a nationwide referendum 93 of ukraine s citizens voted for an independent ukraine and chose leonid krawchuk former communist ideologist as their first democratically elected president on july 10 1994 leonid kuchma former director of the world s biggest rocket plant defeated leonid krawchuk to become the second president of independent ukraine 1 uah vladimir the great grand prince of kiev first started christianity in kievan rus 2 uah yaroslav the wise kyiv prince 5 uah bogdan khmelnitsky public and politician head of the cossack state 10 uah ivan mazepa public and politician head of the cossack state 20 uah ivan franco writer poet social and political activist 50 uah mykhailo hrushevsky politician 100 uah taras shevchenko poet writer painter social and political activist 200 uah lesya ukrainka writer and cultural figure 500 uah hryhorii skovoroda philosopher educator poet  ', 0),
(88, 'node', ' food in ukraine ukraine is the second largest country in europe it is located between poland and russia it is slightly smaller than the state of texas much of the southeastern part of the country borders the black sea most of ukraine s land is made up of fertile plains or steppes and plateaus mountains are found only in the west and extreme south in the crimean peninsula this area s climate is subtropical winters vary from cool along the black sea to cold farther inland the temperature inland ranges from 66 f in july to 21 f in january northern and western ukraine average 27 inches of rainfall a year this temperate climate is ideal for growing crops in fact more than 57 percent of the ukraine s fertile soil is suitable for growing such crops as sugar beets wheat and potatoes the earliest known farmers in the ukraine were the trypillians 45002000 bc the territory of the ukraine had rich soil and a favorable climate perfect for cultivating crops the trypillians grew barley millet rye and wheat they also herded sheep pigs and cattle wheat was plentiful and soon trading routes were established along ukraine s black sea coast to market the grain the ukraine territory became the crossing road connecting arabia europe and asia life depended on the activities of cultivating soil for crops in prechristian times holidays were celebrated during times of transition from one type of agricultural activity to another these seasonal festivities were later incorporated into christian holidays such as christmas and easter over time ukraine fell under the power of many different countries including poland austria and russia despite being under russian domination for almost 200 years gaining independence only in 1991 ukrainians proudly kept their native traditions customs and cuisine kovbasa sausage and sauerkraut have polish origins varnyky dumplings and holubtsi stuffed cabbage were originally imported from turkey strudels breaded meats and desserts such as cheesecake and tarts were carried over from austrohungarian times although ukrainian dishes have origins from different countries how they are prepared are uniquely ukrainian in ukrainian cuisine when the dough isn t baked it is usually boiled such as kasha hot cereal or fried in the form of dumplings or fritters freshly made dumplings called varenyky are a common ukrainian staple varenyky is dough stuffed with a variety of foods such as potatoes meats cheeses sauerkraut and even fruit such as blueberries or cherries for dessert each region restaurant and family has its own recipe the foothills of the carpathian mountains located in the western ukraine provide pastures for grazing beef and dairy cattle meats such as kovbasa sausage poultry and pork are important to the ukrainian diet pork is considered the national meat and pork fat is often used in cooking it is used mostly for frying but also can be eaten smoked or with salt common dairy products include milk syrnyky cottage cheese fritters nalynsnyk cheesefilled crepes and riazhanka fermented baked milk desserts are often baked into sweet breads cakes and cookies and made with honey and fruits such as plums blueberries and cherries in general ukrainians eat a light breakfast it can be bread with butter served with coffee or tea or pastries such as a creamfilled blintz kasha cereal steamed buckwheat barley or millet with milk may also be served their main meal is eaten around midafternoon and usually consists of soup such as borshch and a dish with meat or poultry the third meal of the day takes place around 6 or 7 pm it is usually a time when all family members get together eating at a restaurant is considered a luxury and is usually not done very often ukrainians eat with a fork in their left hand and a knife in their right hand it is considered impolite to hold your hands under the table during dinner or to put your elbows on the table in order not to seem wasteful ukrainians may eat everything on their plates when they are visiting ukrainians may ask for second helpings to show appreciation for the food hosts often give guests a loaf of bread with salt on top a tradition that dates back many centuries bread and salt were once considered necessary ingredients for health the bread represents hospitality and the salt represents friendship  ', 0),
(89, 'node', ' my love affair with ukraine dropetrovsk ukraine my love affair with ukraine started more than 20 years ago god first called me to the former soviet union in 1992 and i moved to lugansk ukraine in february 1994 imb missionary tom long has lived in and out of ukraine for 20 years with much of the last four years in donetsk the recent unrest has caused him to relocate to dnepropetrovsk please join him in praying for donetsk and ukraine read more youreports in those early years i saw lots of growth numerically in believers and church starts sure there were difficulties like standing in line to purchase bread however seeing people who lived under communism for 70 years stepping forward to live in christ was worth every hardship encountered after three years i returned to the us to attend seminary and eventually went back to ukraine in september 2003 with the international mission board life had dramatically changed in the six years i was gone unfortunately church growth was slowing in the midst of prosperity four years ago i moved to donetsk in the heart of the industrial belt trying to plant churches in eastern ukraine had always been difficult but god blessed me with a group of young people who had the same desire last fall we moved into a rented hall and were averaging 20 people in the worship service we made plans to start new groups but in february 2014 ukraine s president left office his departure set off a series of events that turned our world upside down and led me to leave donetsk in april war came to the city in late may and dispersed the church members to russia and all over ukraine by midjune i knew i would not be returning to donetsk i would go to dnepropetrovsk instead it would be my fifth move in 11 years a move i really didn t want to make yet a move i knew i had to make since i left donetsk god has been teaching me much about loving him with all my heart soul mind and strength and loving my neighbor as myself what does it mean to love my neighbors surely god doesn t mean those neighbors who caused me to flee my apartment my life the city i loved or does being a christ follower mean i must love even those neighbors i ve seen examples of several pastors loving these neighbors in the conflict zone one brother shared with me that during the height of the war their church housed more than 70 people and fed many more this pastor could be retired yet he stayed and served others he told me he couldn t leave it was his duty to stay because the church s doors have been open they have seen numerous people from the neighborhood repent a second pastor and his family have stayed right in the midst of the war their church serves food to their neighbors he drives outside the conflict zone so he can get money and food his family along with a few church members who stayed behind prepares the meals for those who don t have any resources for purchasing food through this ministry the church has seen people more interested in hearing the gospel and some have put their faith in jesus another pastor recently challenged me to pray a list of scriptures back to the lord and to substitute my name for the pronouns so as i sat in the park on a beautiful saturday afternoon i prayed john 1334 a new commandment you gave to tom that tom loves one another just as you have loved tom tom also is to love one another a clear picture came to me of what the lord intended in this verse it doesn t matter where i live whether in texas donetsk or dnepropetrovsk if i am going to be his disciple i must love user  ', 0),
(90, 'node', ' southern baptists assess damage in eastern ukraine slavyansk ukraine bp cities in eastern ukraine once held by prorussian separatists are slowly returning to normal as residents begin to rebuild their wartorn lives natasha s apartment imb workers tom long and joy burnett tell of visiting a home destroyed by war in the eastern ukrainian city of slovyansk a city once held by prorussian separatists name changed i am still trying to process what i saw burnett said from her home in kharkiv an eastern ukrainian city spared by the war i could feel the tears rising in my throat but they just haven t come yet i was impacted deeply but i just haven t let those feelings come to the surface yet burnett and long spent their day touring the city and visiting with church leaders as well as a children s home and the apartment of a woman who lost her home as a result of the attacks on the city long said there are many needs in slovyansk and other towns that had been occupied but are now liberated most of these people depend on the food from their summer garden to get them through the winter he said but the city was under siege from april to july so there is no food from the gardens long added that food for the winter months is just one of many needs residents will have as they begin to rebuild their cities and their lives it s not like you drive into the city and there are huge buildings that are flattened or missing but there were many buildings that were damaged many have holes in the roofs or walls of the building he said and if we are going to help these folks be able to get through the winter we need to begin working soon long and burnett are working alongside baptist global response bgr to help southern baptists mobilize relief efforts in eastern ukraine southern baptists always rise to the occasion long said and i know they will do the same here consider partnering or donating to show god s love to ukrainians who need help to repair homes and broken lives  ', 0),
(91, 'node', ' prayers answered as eastern ukrainian city remains untouched by war kharkiv ukraine our city is under god s wing of protection nadia said she said she feels it when she goes to the main square of kharkiv each morning to pray for her city and for ukraine the eastern ukrainian city located just 20 miles from the russian border was expected to be one of the first to fall to prorussian separatistsbut even though major cities in neighboring areas are controlled by separatists and embroiled in bloody battles today kharkiv remains peaceful and residents say public demonstrations on both sides have all but subsided for more than 130 days believers in kharkiv have started each morning on their knees they believe god has honored their prayers this is not about us nadia said it is not about our prayers but god has been faithful to hear our prayers and to keep our city peaceful and safe the kharkiv prayer circle began at the onset of the euromaidan revolution in kiev started by a small group of evangelical believers mostly baptist the group has grown and some days swells to nearly 200 people joy burnett an international mission board worker based in kharkiv said the group has been faithful to meet regardless of weather or other conflicting factors in the days between the maidan revolution and when violence broke out in the east we were not sure what would happen here in kharkiv burnett said there was lots of fear and uncertainty and for a time burnett left the city as tensions between prorussian separatists and the ukrainian army rose i really missed being with the group during that time burnett said i may have been living somewhere else but at 7 o clock each morning my heart was always with my brothers and sisters in kharkiv i really wanted to be with them on the square praying nadia said she believes this time of prayer each day is very special and different from the prayer times they have in their church it is a privilege for us to kneel here praying to him she said there is something special about when we pray outdoors heaven touches earth when we pray here under the open sky as time has passed not only has the group grown it also has become multiconfessional as well they say it is not uncommon for baptists to be praying alongside ukrainian orthodox pentecostals and even messianic jewish believers there were always barriers between us in the past nadia said but now those barriers are much less we greet each other in the love that comes with being fellow believers and we pray openly with each other it is very sweet victoria a kharkiv native who is studying at an american university returned to ukraine to spend the summer with her family she and other students regularly attend the morning prayer meetings she believes the daily gathering is a great witness to nonchristians who pass by every day on their way to work they see us praying here she said and they understand that we believe in something that is bigger nadia added these students understand that they are fighting for their future on their knees when the group began praying together they thought it would last only a few weeks now more than six months later many like nadia hope they will continue meeting daily to pray even after the conflict ends i would like to come here every morning she said maybe even until the lord returns  ', 0),
(92, 'node', ' music and dances many of its ethnic groups living within ukraine have their own  unique musical traditions  the most striking general characteristic of authentic ethnic ukrainian folk music is the wide use of minor modes ritual songs of ukraine are frequently in recitative style essentially monodic for example shchedrivka shchedryk known in the west as carol of the bells the bulk of ukrainian folk songs melodies are based on scales identical to mеdieval modes but differ in melodic structure ukrainian vocal music exhibits a wide variety of forms monodic heterophonic homophonic harmonic and polyphonic ukrainian folk song singing style can be divided into a number of broad aesthetic categories solo singing primarily ritual songs including holosinnya sung at wakes solo singing with instrumental accompaniment of the bandura kobza or lira by professional singers known as kobzari or lirnyky the highest form of development of this style of singing can be seen in the lyric historical folk epics known as dumy archaic type of modal a cappella vocal style in which a phrase sung by a soloist is answered by a choral phrase in two or three voice harmony traditional ukrainian instruments are kobza lute bandura violin basolya 3string cello lira hurdygurdy tsymbaly sopilka duct flute trembita alpenhorn fife volynka bagpipes buben frame drum tulumbas kettledrum resheto tambourine and drymba varhan jaw harp troyisti muzyky are traditional instrumental ensembles of ukraine literally it means three musicians who typically make up the ensemble for example violin sopilka and buben  traditional dances of ukraine are  kozak kozachok hopak hrechanyky tropak kolomyjka and hutsulka shumka arkan metelytsia kateryna kadryl and chabarashka there are also dances originating outside ukraine but which are quite popular polka krakowiak mazurka barynya csárdás waltz and kamarynska ukrainian instrumental and dance music has also influenced jewish and gypsy music the first professional music academy was set up in hlukhiv ukraine in 1738 where students were taught to sing play violin and bandura from manuscripts as a result many of the earliest composers and performers within the russian empire were ethnically ukrainian having been born or educated in hlukhiv or had been closely associated with this music school ukrainian national school of classical music was spearheaded bymykola lysenko this school includes such composers as mykola leontovych kyrylo stetsenko andlevko revutsky most of their music contains ukrainian folk figures and are composed to ukrainian texts there are also many famous composers and performers of nonukrainian ethnicity who were born or at some time were citizens or were active in ukraine among them are franz xavier mozart rheinhold gliere isaak dunayevsky sergei prokofiev and yuliy meitus among famous performers are volodymyr horovyts sviatoslav richter david oistrakh and isaac stern the music of these composers rarely contains ukrainian folk motives and are more often written to the texts of russian or polish poets  ', 0),
(93, 'node', ' ukrainian clothes the traditional dress of ukraine is a centuries old unique and distinctive emblem of the ukrainian culture this dress has developed after the tremendous variation due to its association with the early slavonic domination during which many materials were introduced by the cloth merchants the traditional dress of ukraine is also full of ornamental designs fantastic embroidery and remarkable exposition even today the national dress of ukraine is hand woven and fabulously decorated the embroidery is an ancient practice which is applied to the traditional dress of ukraine and it is varied from region to region in the country embellished with the antiquated motifs and harmonic arrangements full of colors and exotic stitches the traditional dress for men in ukraine was normally made with sheepskin and leather which was also decorated with embroidery and cords tassels and other accessories the men also wore kontusz a long robe usually reaching to below the knees with a set of decorative buttons down the front the elite and noble ukrainian men also used a long garment which was known as zupan similarly a traditional pant was also used known as sharovary which was free to hips often with assembly at the waist collected at the bottom near the ankle the traditional dress for women in ukraine contains the ethnic embroidery and usually it was made of homemade linen which was produced by loom in the cold winters kozhushankas were worn which were prepared with the sheepskin coat the coats varied in color from region to region the edges of kozhushankas were trimmed with black sheepskin or other differently dyed material the married women used to wear ochipok which was a traditional headdress that covered the entire head with a slit in the back and laces that pull it tightly around the head similarly namitka is a long thin fabric wrapped around the head and tied in the back the traditional dress of ukraine for the unmarried girls is never completed without mentioning a circular head floral decoration this is the ukrainian flower wreath which remains a part of the ukrainian national attire and is worn on festive occasions and on holy days the fragrant flowers give the glamorous and refreshing touch to the costume nowadays the folk dancers wear the flower wreath during their performances another part and parcel of the traditional dress of ukraine is the artistic and handmade jewelry usually made with glass beads using strong synthetic threads bead work is extremely popular in carpathian mountains area but lots of artists make beaded jewelry in the cities of lviv and ternopil today the ancient patterns are mixed with the modern stencils and the ukrainian women love to wear these traditional ornaments on jeans and shirts the female footwear of the traditional dress of ukraine was made of red and yellow leather which was also used for decorating skins the traditional dress of ukraine also reflects the impressive history and behaviorism of the ukrainian nation  ', 0);
