(94, 'node', ' orthodox church as of january 1 2013 ukraine had 33977 churches and religious organizations today more than 97 of the registered religious communities in ukraine are christian about half of them are orthodox the other half is split among catholics and protestants the category of traditional in informal terminology churches has three major orthodox jurisdictions the ukrainian greek catholic church the roman catholic church the armenian community also to some extent the communities of lutherans calvinists baptists pentecostals and adventists the biggest church in terms of the number of registered communities in ukraine is the ukrainian orthodox church for better understanding in relation to other registered churches in ukraine it is sometimes followed by the abbreviation mp moscow patriarchate but this addition is not part of the official name of the church today this denomination has 12251 registered religious entities including 11952 communities the second largest registered community in ukraine is the ukrainian orthodox church of the kyiv patriarchate today it has 4508 registered associations of which 4371 are communities and 3021 clergymen the third largest orthodox church in ukraine is the ukrainian autocephalous orthodox church which has 1227 registered religious associations including 1190 parishes in which are serving 699 clergymen ukraine also has 57 registered communities of the russian orthodox oldrite church which are united in the kyivan archeparchy and 11 communities of old believersbespopovtsy there are also 33 communities of the russian orthodox church outside of russia and 31 parishes of the russian true orthodox church and 101 orthodox communities that belong to various small associations in particular there is a parish of the romanian orthodox church which is registered as the autonomous orthodox parish ukraine also has two national catholic churches the ukrainian greek catholic church and the roman catholic church in ukraine the ukrainian greek catholic church is the largest eastern catholic church in the world in ukraine it has 3825 registered organizations 3646 parishes in which 2424 clergymen are serving the roman catholic church has 1081 registered religious associations including 909 parishes in which 579 clergymen are serving another community in ukraine is the socalled noncaledonian armenian apostolic church the community of which is in kyiv lviv odesa kharkiv donetsk dnipropetrovsk and a few cities in the crimea among the protestant denominations the most common in ukraine is the allukrainian union of evangelical christian baptists with 2705 registered communities and the ukrainian union of christians of evangelical faithpentecostals with 1595 associations in addition to these major denominations there are many other protestant and neoprotestant communities in ukraine there are also representatives of several denominations of judaism and islam at the end of 1980s neopagan communities appeared in ukraine the number of other religious and religious philosophical buddhism trends including nontraditional and new religious movements has been dynamically growing since december 1996 the allukrainian council of churches and religious organizations auccro operates it unites about 90 of the religious communities in ukraine since late 2002 along with the auccro operates the council of heads of christian churches of ukraine which includes representatives of several leading christian denominations  ', 0),
(95, 'node', ' statistics religion in ukraine has a somewhat different mix of faiths as compared to religion in russia although the region was once home to rather large muslim and jewish communities islam and judaism have diminished significantly from their historic heights ukraine unlike russia is predominately christian with greater than 90 of religiously active citizens belonging to orthodox catholic or protestant denominations 2006 razumkov centre survey according to the same 2006 razumkov centre survey the breakdown of religious faith in ukraine is as follows 149 belong to the ukrainian orthodox church kiev patriarchate not recognized by the eastern orthodox communion uses ukrainian and slavonic as liturgical languages 109 belong to the ukrainian orthodox church moscow patriarchate jurisdiction of the russian orthodox church has the largest number of churches in ukraine claims up to 75 of the ukrainian population official website uses predominately the old slavonic language for services 53 belong to the ukrainian greek catholic church practices byzantine rites similar to orthodox christianity but is united with the roman catholic church formed in 1596 to unify orthodox and roman catholic believers banned within the soviet union from 1946 to 1989 uses the ukrainian language 1 belong to the ukrainian autocephalous orthodox church predominant in western ukraine uses the ukrainian language 9 are of protestant denominations pentecostal baptist lutheran mennonites adventists 6 belong to the roman catholic church mostly ukrainians of polish ancestry from western ukraine 2 adhere to islam consist of indigenous crimean tatar as well as muslim immigrants from former soviet states 1 practice judaism  32  said they belong to other denominations 625   stated they were not religious or didn t belong to any particular religious denomination  ', 0),
